MATCH (d:Drug) 
WHERE toLower(d.displayName) = toLower('Ribavirin') 
RETURN d.casNumber AS casNumber, d.primaryDomainId AS drugId, d.displayName AS drugName;

MATCH (d:Drug)-[:DrugHasContraindication]->(dis:Disorder)
WHERE toLower(d.displayName) = toLower('Paroxetine')
RETURN dis.primaryDomainId AS disorderId, dis.displayName AS disorderName;

MATCH (g:Gene)-[r:GeneAssociatedWithDisorder]->(dis:Disorder {primaryDomainId:'mondo.0016419'})
WHERE r.scoreOpenTargets IS NULL OR r.scoreOpenTargets > 0.3
RETURN g.primaryDomainId AS geneId, g.displayName AS geneName;

MATCH (v:GenomicVariant)-[:VariantAssociatedWithDisorder]->(d1:Disorder {primaryDomainId:'mondo.0005147'}),
      (v)-[:VariantAssociatedWithDisorder]->(d2:Disorder {primaryDomainId:'mondo.0005148'})
RETURN DISTINCT v.primaryDomainId AS variantId, v.displayName AS variantName;

MATCH (v:GenomicVariant)-[:VariantAffectsGene]->(g:Gene)
WHERE v.chromosome = 'X' AND v.position = 12345 AND v.alternativeSequence = 'A'
RETURN g.primaryDomainId AS geneId, g.displayName AS geneName;

MATCH (v:GenomicVariant)-[:VariantAssociatedWithDisorder]->(d:Disorder)
WHERE v.chromosome = '2' AND v.position = 78901 AND d.primaryDomainId IN ['mondo.0006489', 'mondo.0002205', 'mondo.0002971', 'mondo.0005105', 'mondo.0000929']
RETURN v.referenceSequence AS referenceSequence, v.primaryDomainId AS variantId, v.displayName AS variantName, d.primaryDomainId AS disorderId, d.displayName AS disorderName;

MATCH (v:GenomicVariant)-[:VariantAffectsGene]->(g:Gene)-[:ProteinEncodedByGene]-(p:Protein)-[:ProteinHasSignature]->(s:Signature)
WHERE toLower(s.displayName) = toLower('MHC_I')
RETURN DISTINCT v.primaryDomainId AS variantId, v.displayName AS variantName, g.primaryDomainId AS geneId, g.displayName AS geneName, p.primaryDomainId AS proteinId, p.displayName AS proteinName, s.primaryDomainId AS signatureId, s.displayName AS signatureName;

MATCH (p:Protein)-[:ProteinHasGOAnnotation]->(g:GO {primaryDomainId:'go.0006997'}),
      (p)-[:ProteinHasGOAnnotation]->(gp:GO {primaryDomainId:'go.0007186'})
RETURN p.primaryDomainId AS proteinId, p.displayName AS proteinName;

MATCH (g:GO)
WHERE toLower(g.displayName) = toLower('plasma membrane')
RETURN g.primaryDomainId AS goId, g.displayName, g.description, g.dataSources;

MATCH (p:Protein)-[:ProteinHasSignature]->(s:Signature)
WHERE toLower(p.displayName) = toLower('RFA1_HUMAN')
RETURN s.primaryDomainId AS signatureId, s.displayName AS signatureName;

MATCH (p:Protein)-[:ProteinEncodedByGene]->(g:Gene)
WHERE toLower(p.displayName) = toLower('ESR1_HUMAN')
RETURN g.primaryDomainId AS geneId, g.displayName AS geneName;

MATCH (p:Protein)
WHERE toLower(p.displayName) = toLower('HSP7C_HUMAN')
RETURN p.primaryDomainId AS proteinId, p.displayName AS protein, p.synonyms AS synonyms;

MATCH (p:Protein)-[:ProteinExpressedInTissue]->(t:Tissue {primaryDomainId:'uberon.0002107'})
MATCH (d:Drug)-[:DrugHasTarget]->(p)
RETURN p.primaryDomainId AS proteinId, p.displayName AS proteinName, d.primaryDomainId AS drugId, d.displayName AS drugName;

MATCH (g:Gene)-[:GeneExpressedInTissue]->(t:Tissue)
WHERE toLower(g.displayName) = toLower('BRCA2')
RETURN t.primaryDomainId AS tissueId, t.displayName AS tissueName;

MATCH (p:Protein)-[:ProteinInPathway]->(pw:Pathway), (d:Drug)-[:DrugHasTarget]->(p)
WHERE toLower(pw.displayName) = toLower('Immune System pathway')
RETURN DISTINCT p.primaryDomainId AS targetProteinId, p.displayName AS targetProteinName, d.primaryDomainId AS drugId, d.displayName AS drugName;

MATCH (d:Drug)-[:DrugHasSideEffect]->(se:SideEffect {primaryDomainId:'meddra.10000085'})
OPTIONAL MATCH (d)-[:DrugHasTarget]->(p:Protein)-[:ProteinExpressedInTissue]->(t:Tissue)
RETURN DISTINCT d.primaryDomainId AS drugId, d.displayName AS drugName, t.primaryDomainId AS tissueId, t.displayName AS tissueName;
